import {useState,useEffect} from 'react';
import Products from './Products';
function Mid3() {
    const [students, setStudent]= useState([]);
    useEffect(()=>{
        fetch('api/')
        .then((res)=>{return res.json()})
        .then((students)=>{
            setStudent(students)
            //console.log(students);
        })
    },[])
    return ( 
        <div>
             {students.map((result)=>(
                 <div key={result._id}>
                     <h1>{result.name}</h1>
                     <p>{result.disc}</p>
                     <p>{result.price}</p>
                     <Products/>
                 </div>
             ))}
        </div>
     );
}

export default Mid3;
